import React from 'react';

const ProductoItem = (props) => {
    const { nombre, precio, categoria, img, body } = props;

    return(
        <div className='productos'>
            <h1>{nombre}</h1>
            <p>{precio}</p>
            <p>{categoria}</p>
            <img src='{img}'/>
            <div dangerouslySetInnerHTML={{ __html:body}}/>
            <hr />
        </div>
    );
}

export default ProductoItem;
